<html>
<head>
<meta name="viewport" content="initial-scale=1.0, user-scalable=no" />
<meta http-equiv="content-type" content="text/html; charset=UTF-8" />
<title>Google Maps - gmplot</title>
<script type="text/javascript" src="https://maps.googleapis.com/maps/api/js?libraries=visualization&key=AIzaSyACg1er5gcDs_BDRIuQZPIRP5AxzYVjisg"></script>
<script type="text/javascript">

            strokeColor: '#000000',
            strokeOpacity: 1.0,
            strokeWeight: 1,

            map: map,
            center: new google.maps.LatLng(48.1013714, -122.2271894),
            radius: 60.96

            strokeColor: '#000000',
            strokeOpacity: 1.0,

        });

        new google.maps.Circle({

            strokeOpacity: 1.0,
            strokeWeight: 1,
            fillColor: '#000000',

            radius: 60.96
        });

        new google.maps.Circle({
            strokeColor: '#000000',

            fillOpacity: 0.5,

            center: new google.maps.LatLng(48.1013714, -122.2271894),
            radius: 60.96
        });

        new google.maps.Circle({
            strokeColor: '#000000',
            strokeOpacity: 1.0,
            strokeWeight: 1,
            fillColor: '#000000',
            fillOpacity: 0.5,
            map: map,
            center: new google.maps.LatLng(48.1013714, -122.2271894),
            radius: 60.96
        });

        new google.maps.Circle({
            strokeColor: '#000000',
            strokeOpacity: 1.0,
            strokeWeight: 1,
            fillColor: '#000000',
            fillOpacity: 0.5,
            map: map,
            center: new google.maps.LatLng(48.1013714, -122.2271894),
            radius: 60.96
        });

        new google.maps.Circle({
            strokeColor: '#000000',
            strokeOpacity: 1.0,
            strokeWeight: 1,
            fillColor: '#000000',
            fillOpacity: 0.5,

            radius: 60.96

        new google.maps.Circle({

            fillOpacity: 0.5,
            map: map,
            center: new google.maps.LatLng(48.1013714, -122.2271894),
            radius: 60.96
        });

        new google.maps.Circle({
            strokeColor: '#000000',
            strokeOpacity: 1.0,
            strokeWeight: 1,
            fillColor: '#000000',
            fillOpacity: 0.5,
            map: map,
            center: new google.maps.LatLng(48.1013714, -122.2271894),

    }
</script>
</head>
<body style="margin:0px; padding:0px;" onload="initialize()">

</html>
